import os;
import subprocess;
import sys;

os.environ[ LANG ] =  C.UTF-8 ;

pacman = subprocess.Popen([ pacman ,  -Qi ], stdout=subprocess.PIPE);

size_map = {
     B : 1,
     KiB : 2 ** 10,
     MiB : 2 ** 20,
     GiB : 2 ** 30
};

count = 0;

for line in pacman.stdout:
    line = line.decode(sys.stdout.encoding);
    if not  Installed Size  in line:
        continue;
    line = line.strip().split( : )[1].strip().split(   );
    count += float(line[0]) * size_map[line[1]];

print(f {count/(2**30)} GiB );
```

